import React, { Component } from 'react'

export default class List extends Component {
    
  render() {
    const names=['deepthi','mentor','sai','manasa']
    const nameList=names.map((el,index)=>{return <p key={index}>{el}</p>})
    console.log(nameList)
    return (
      <>
        {nameList}
      </>
    )
  }
}
